  `mail_box` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `investors_profile` varchar(255) DEFAULT NULL COMMENT '投资人简介',
  `investors_company_name` varchar(255) DEFAULT NULL COMMENT '公司全名',
  PRIMARY KEY (`id`)
